import time
def findSubstring(s: str, words: list[str]) -> list[int]:
    output = []
    step = len(words[0])
    words_size = len(words)
    string_size = len(s)
    total_step = words_size * step
    if string_size < words_size or not words or not s: 
        return []
    if string_size == step:
        if s in words:
            return [0]
        else:
            return []

    idx = 0
    while idx <= string_size - total_step:
        word = s[idx: idx + step]
        if word in words:
            sub_string = s[idx:idx + total_step]
            chunked = [sub_string[i:i+step] for i in range(0, len(sub_string), step)]
            if sorted(chunked) == sorted(words):
                output.append(idx)
        idx += 1
    
    return output


